import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import Card from "pnnl-react-core/lib/Card";
import Grid from "react-bootstrap/es/Grid";
import Row from "react-bootstrap/es/Row";
import Col from "react-bootstrap/es/Col";
//import { Col, Row } from "react-bootstrap";
import LHSPlot from "./LHSPlot";
import LCSPlot from "./LCSPlot";
import LCFPlot from "./LCFPlot";
import ELFPlot from "./ELFPlot";
import CVGPlot from "./CVGPlot";

var tm30_data;

class Report extends React.Component {
  render() {
    return (
      <div>
        <h1>Report Page</h1>
        <br />
        {!(this.props.location.state == null) ? (
          <div>
            {
              // <ResultsTable data={this.props.location.state.data} />
            }
          </div>
        ) : (
          <Card>
            <h2>No data Calculated</h2>
            <h5>
              <ol>
                <li>Click on Calculator above</li> <br />
                <li>Choose which way to calculate data</li> <br />
                <li>Click Calculate and you will be redirected here</li>
              </ol>
            </h5>
          </Card>
        )}
        {!(this.props.location.state == null) ? (
          <Grid>
            {console.log(this.props.location.state.data)}

            <Row>
              <Col>
                <Card>
                  <table>
                    <tr>
                      <th>Variable</th>
                      <th>Test</th>
                      <th>Ref</th>
                    </tr>
                    <tr>
                      <td>CCT</td>
                      <td>
                        {
                          this.props.location.state.data.tm30.Numerical_Results
                            .CCT[0]
                        }
                      </td>
                      <td>
                        {
                          this.props.location.state.data.tm30.Numerical_Results
                            .CCT[1]
                        }
                      </td>
                    </tr>
                    <tr>
                      <td>DUV</td>
                      <td>
                        {" "}
                        {
                          this.props.location.state.data.tm30.Numerical_Results
                            .DUV[0]
                        }
                      </td>
                      <td>
                        {" "}
                        {
                          this.props.location.state.data.tm30.Numerical_Results
                            .DUV[1]
                        }
                      </td>
                    </tr>
                    <tr>
                      <td>u</td>
                      <td>
                        {" "}
                        {
                          this.props.location.state.data.tm30.Numerical_Results
                            .u[0]
                        }
                      </td>
                      <td>
                        {" "}
                        {
                          this.props.location.state.data.tm30.Numerical_Results
                            .u[1]
                        }
                      </td>
                    </tr>
                    <tr>
                      <td>v</td>
                      <td>
                        {" "}
                        {
                          this.props.location.state.data.tm30.Numerical_Results
                            .v[0]
                        }
                      </td>
                      <td>
                        {" "}
                        {
                          this.props.location.state.data.tm30.Numerical_Results
                            .v[1]
                        }
                      </td>
                    </tr>
                  </table>
                </Card>
              </Col>
            </Row>
            <br />
            {/*
            <LCSGoogleGraph
              data={
                this.props.location.state.data.tm30.Numerical_Results
                  .local_chroma_shift
              }
            ></LCSGoogleGraph>

            <br />

            <LHSGoogleGraph
              data={
                this.props.location.state.data.tm30.Numerical_Results
                  .local_hue_shift
              }
            ></LHSGoogleGraph>

            <br />

            <LCFGoogleGraph
              data={
                this.props.location.state.data.tm30.Numerical_Results
                  .local_color_fidelity
              }
            ></LCFGoogleGraph>
            <br />
            <Card>
              <LCSd3
                data={
                  this.props.location.state.data.tm30.Numerical_Results
                    .local_chroma_shift
                }
              ></LCSd3>
            </Card>

            <br />
              */}
            {console
              .log
              //`pathx = ${this.props.location.state.data.tm30.Numerical_Results.path_xref}`
              ()}
            <Row>
              <Col xs={6}>
                <Card>
                  <LCSPlot
                    data={
                      this.props.location.state.data.tm30.Numerical_Results
                        .local_chroma_shift
                    }
                  ></LCSPlot>
                </Card>
              </Col>
              <Col xs={6}>
                <Card>
                  <LHSPlot
                    data={
                      this.props.location.state.data.tm30.Numerical_Results
                        .local_hue_shift
                    }
                  ></LHSPlot>
                </Card>
              </Col>
            </Row>
            <br />
            <Row>
              <Col xs={6}>
                <Card>
                  <LCFPlot
                    data={
                      this.props.location.state.data.tm30.Numerical_Results
                        .local_color_fidelity
                    }
                  ></LCFPlot>
                </Card>
              </Col>
              <Col xs={6}>
                <Card>
                  <ELFPlot
                    test={
                      this.props.location.state.data.tm30.Numerical_Results
                        .normalized_SPD_test
                    }
                    ref_spd={
                      this.props.location.state.data.tm30.Numerical_Results
                        .normalized_SPD_ref
                    }
                  ></ELFPlot>
                </Card>
              </Col>
            </Row>
            <br />
            <Row>
              {<Col xs={3}></Col>}
              <Col xs={6}>
                <Card>
                  <CVGPlot
                    xtest={
                      this.props.location.state.data.tm30.Numerical_Results
                        .path_xtest
                    }
                    ytest={
                      this.props.location.state.data.tm30.Numerical_Results
                        .path_ytest
                    }
                    xref={
                      this.props.location.state.data.tm30.Numerical_Results
                        .path_xref
                    }
                    yref={
                      this.props.location.state.data.tm30.Numerical_Results
                        .path_yref
                    }
                    rf={
                      this.props.location.state.data.tm30.Numerical_Results.rg
                    }
                    rg={
                      this.props.location.state.data.tm30.Numerical_Results.rf
                    }
                    cct={
                      this.props.location.state.data.tm30.Numerical_Results
                        .CCT[0]
                    }
                    duv={
                      this.props.location.state.data.tm30.Numerical_Results
                        .DUV[0]
                    }
                  ></CVGPlot>
                </Card>
              </Col>
              {<Col xs={3}></Col>}
            </Row>
          </Grid>
        ) : (
          /*
          <div class="reportImage">
            <ModalImage
              small="http://localhost:8000/tm30_output.png"
              large="http://localhost:8000/tm30_output.png"
              alt=""
            />
          </div>
        */
          <div></div>
        )}
      </div>
    );
  }
}

export default Report;
